import { Box, Typography } from "@mui/material";
import React from "react";

function Blogs() {
  return (
    <Box
      sx={{
        width: "100%",
        height: "500px",
        backgroundColor: "yellow",
      }}
    >
      <Typography
        sx={{
          fontFamily: "Manrope, sans-serif !important",
          padding: 5,
          textAlign:'center',
          marginLeft: "410px",
          fontSize: "2.3rem",
          fontWeight: "700",
          color: "black",
          lineHeight: 1.2,
          position: "relative",
          display: "inline-block",
          "&::after": {
            content: '""',
            position: "absolute",
            right: 40,
            borderRadius: "5px",
            bottom: "35px",
            width: "70px",
            height: "4px",
            backgroundColor: "#3593b0",
          },
        }}
      >
        Blogs
      </Typography>
    </Box>
  );
}

export default Blogs;
